import React from 'react';
import { dummyPost } from '../dummy.js';
import styled from 'styled-components';

export const Postform = styled.div`
display: flex;
width: 260px;
height: 300px;
background-color: yellow;
`
export const Postcontent = styled.div`
flex: 1 1 30%;
white-space: nowrap;
overflow:hidden;
text-overflow: ellipsis;
`
export const Postimg = styled.img`
flex: 1 1 30%;
`
export const Posttitle = styled.div`
flex: 1 1 30%;
`
export const Postlikes = styled.div`
flex: 1 1 30%;
`
export default function Boardpostform(){
    return(
        <center>
            <Postform>
            <PostformPostimg className='item-img' src={dummyPost[0].image} alt={dummyPost[0].title} />
            <PostformPosttitle className='item-name' >{dummyPost[0].title}</PostformPosttitle>
            <br /><br />
            <PostformPostcontent>{dummyPost[0].contents}</PostformPostcontent>
            <PostformPostlikes className='item-price' >{dummyPost[0].total_likes}</PostformPostlikes>
            </Postform>
        </center>
    )
}
